    [],nt"revision_timestamp": "2016-07-27T22:56:00.886256",nt"name": "annual-water-management-program-report-prime-hook-national-wildlife-refuge-1998",nt"isopen":
    false,nt"url": null,nt"notes": "The main goal of Prime Hook's water management
    program is to increase the carrying capacity of the refuge's marshes by maximizing
    the annual production of diverse food resources via asynchronistic water level manipulations
    between the three refuge impoundments. The objective is to promote the diverse production
    of plant and animal food resources for migrating and wintering waterfowl and migrating
    shorebirds, while simultaneously creating complimentary structural components in
    the form of diversified wetland habitat types to meet the multiple needs of as many
    wetland-dependent species as possible throughout the year.",nt"license_title":
